result:
.card-container{
    width: 100%;
    min-width: 100%;
    padding: 20px;
}
.card{
    width: 100%;
    min-height: 120px;
    margin: 0 auto;
    margin-top: 20px;
    border-radius: 5px;
    padding: 5px;
    cursor: pointer;
    transition: all ease 0.5s;
}
.card:hover{
    transform: scale(1.05);
}
.card-img{
    width: 90%;
    height: 100px;
    margin-top: 10px;
    margin-left: 10px;
}
.card-content{
    width: 100%;
    height: 100%;
    display: flex;
    flex-direction: column;
}
.card-title{
    font-size: 18px;
    font-weight: bold;
    color: #fff;
    margin-top: 10px;
}
.divider{
    width: 100%;
    height: 0;
    border-top: 1px solid #fff;
    margin-top: 5px;
}
.card-detail{
    font-size: 12px;
    color: #fff;
    margin-top: 5px;
}
    .dialog_title{
    width: 100%;
    height: 30px;
    display: flex;
    flex-direction: row;
    align-items: center;
}
.dialog_title span{
    font-size: 15px;
    color: #555;
    font-weight: bold;
}
.main-dialog{
    margin-top: 20px;
    width: 100%;
    min-height: 200px;
    display: flex;
    flex-direction: row;
}
.main-dialog-img{
    width: 30%;
    height: 150px;
    box-shadow:  0 0 10px 5px rgba(153, 153, 153, 0.2);
}
.main-dialog-img img{
    width: 100%;
    height: 100%;
}
.dialog-title{
    width: 60%;
    margin-left: 20px;
    display: flex;
    flex-direction: column;
}
.divider1{
    width: 100%;
    height: 0;
    border-top: 2px solid #333;
}
.dialog-model-name{
    font-size: 20px;
    color: #555;
    font-weight: bold;
    margin-bottom: 10px;
    margin-left: 20px;
}
.dialog-model-describe{
    margin-top: 10px;
}
